// App.js
import React from "react";
import { ImageProvider } from "./ImageContext";
import ImageUploader from "./ImagePreview";
import ImagePreview from "./ImageAdjustments";
import ImageAdjustments from "./ImageAdjustments";

function App() {
  return (
    <ImageProvider>
      <div className="App">
        <h1>Image Processing App</h1>
        <ImageUploader />
        <ImagePreview />
        <ImageAdjustments />
      </div>
    </ImageProvider>
  );
}

export default App;
